def shrink_polymer(input_polymer)
	polymer = input_polymer.dup
	pos = 0
	while pos < polymer.length-1
		if polymer[pos] == polymer[pos+1].swapcase
			polymer = polymer[0, pos] + (pos<polymer.length-2 ? polymer[pos+2..-1] : '')
			pos = [pos-1, 0].max
			next
		end
		pos += 1
	end
	return polymer.length
end

def remove_letter_and_shrink(input_polymer)
	min_shrink = [1000000, '.']
	('a'..'z').each { |c|
		polymer = input_polymer.gsub(/#{c}/i, '')
		clen = shrink_polymer(polymer)
		min_shrink = [min_shrink, [clen, c]].min
	}
	return min_shrink
end

pp shrink_polymer(input)
pp remove_letter_and_shrink(input)

